isclosures, terms and policies before agreeing thereto.\u003C\u002Fp\u003E\u003Cp\u003EYou agree that by submitting your information to us on this website, we may share it, either directly or through intermediary agents and\u002For entities (including, lead aggregators and vendors to such businesses), with one or more third-parties, such as solar and\u002For home improvement product\u002Fservice providers, marketers of such products\u002Fservices, and\u002For affiliate companies (collectively, including intermediaries, Third-Parties). We also rely on third party service providers to use website tracking technologies to collect and record your activities and movements across our websites throughout your browsing session, consistent with your notice and consent, for purposes of our own internal analytics and improving our products, services, and user experience. We describe how your information is shared in our Privacy Policy, which you should carefully review.\u003C\u002Fp\u003E\u003Cp\u003EWe are a marketing lead generator\u002Fadvertising referral service. We do not charge you a fee. We possess a material financial connection to Third-Parties in that we are compensated for each purchased lead. We are not a solar and\u002For home improvement product\u002Fservice provider, or a representative thereof. We do not provide price quotes. Quotes are provided by third-party product\u002Fservice providers. We are not affiliated with or endorsed by the U.S. government or any federal program. We do not control\u002Fare not responsible for the actions of Third-Parties.\u003C\u002Fp\u003E\u003Cp\u003EThird-Parties have the option to purchase a given lead from us. There is no guarantee that you will be accepted by a Third-Party. Your information may be sold and re-sold multiple times leading to multiple offers from solar and\u002For home improvement product\u002Fservice providers. You may be contacted multiple times by numerous Third-Parties for products\u002Fservices.\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EThe selection of a Third-Party to acquire your information may be determined primarily by the price the purchaser is willing to pay for the information (e.g., the higher the price, the better the purchasers position) and\u002For a comparison thereof with available products\u002Fservices, including solar and\u002For home improvement-related products\u002Fservices.\u003C\u002Fp\u003E\u003Cp\u003EFollowing submission of your information, you may be redirected to the website of a Third-Party. Carefully consider that Third-Parties may retain or use your information even if you do not use their products\u002Fservices. Contact Third-Parties directly concerning their privacy policies, which may differ from our Privacy Policy. If you have any questions or wish to remove your information from a Third-Partys database, you need to contact that Third-Party directly. Each Third-Party has their own terms, conditions and policies and we do not have access to them. Always carefully review all terms and policies.\u003C\u002Fp\u003E\u003Cp\u003EEligibility may depend upon various factors. Service is void where prohibited. Exclusions, limitations and conditions may apply. We expressly disclaim liability for, without limitation, Third-Party products\u002Fservices. You are not obligated to use our lead generation service, initiate contact with Third-Parties, or agree to purchase any product\u002Fservice. If you do not desire to receive further telephone communications from Third-Parties, you have the right to request from those Third-Parties that you be placed on their Do-Not-Call list. We do not control or maintain Do-Not-Call lists for Third-Parties. To opt-out of telephone communications from Third-Parties, you are solely responsible for making a Do-Not-Call request directly to any Third Parties. For details about the privacy rights we offer, including any opt-out rights, please consult our Privacy Policy.\u003C\u002Fp\u003E\u